import React, { useState, useEffect } from 'react';
import axios from 'axios';

const  Carwithapi=()=> {
  const [movie, setmovie] = useState([]);

  useEffect(() => {
    axios.get('http://www.omdbapi.com/?s="love"&y=2024&type=movie&apikey=ff8166a')

      .then(response => {
        
        
        setmovie(response.data.Search);
        
        console.log("this is data",movie);
       console.log("this is response", response.data)

       
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    
    movie.Search.map((dt,index)=>
    {
      return(
        <div className="card" style={{width: "18rem;", height:"20rem"}}>
  <img src={dt.Poster} style={{width: "18rem;", height:"20rem"}}  className="card-img-top" alt="..."/>
  <div className="card-body">
    <h5 className="card-title">Movie Title:{dt.Title}</h5>
    <p className="card-text">Plot:{dt.Plot}</p>
  </div>
  <ul className="list-group list-group-flush">
    <li className="list-group-item">{dt.Year}</li>
    <li className="list-group-item">{dt.Genre}</li>
    <li className="list-group-item">{dt.Released}</li>
  </ul>
  <div className="card-body">
    
    <a href="#" className="card-link">View Detail</a>
  </div>
</div>
    
      )
    })

    
    
   
  );
}

export default Carwithapi;
